<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>{config('app.name')}</title>
    <link rel="shortcut icon" href="data:image/svg+xml;base64," />

    <style>

        html,body {
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #1a1d20;
            font-family: system-ui, -apple-system, "Segoe UI", Roboto, "Helvetica Neue", Arial, "Noto Sans", "Liberation Sans", sans-serif, "Apple Color Emoji", "Segoe UI Emoji", "Segoe UI Symbol", "Noto Color Emoji";
            color: #dee2e6;
            height: 100%;
        }

        .d-flex {
            display: flex;
        }

        .justify-content-center {
            justify-content: center;
        }

        .align-items-center {
            align-items: center;
        }

        .ms-1 {
            margin-left: 0.25rem;
        }

        .me-1 {
            margin-right: 0.25rem;
        }

        .mb-1 {
            margin-bottom: 0.25rem;
        }

        .mt-1 {
            margin-top: 0.25rem;
        }

        .ms-2 {
            margin-left: 0.5rem;
        }

        .me-2 {
            margin-right: 0.5rem;
        }

        .mb-2 {
            margin-bottom: 0.5rem;
        }

        .mt-2 {
            margin-top: 0.5rem;
        }

        .ms-3 {
            margin-left: 1rem;
        }

        .me-3 {
            margin-right: 1rem;
        }

        .mb-3 {
            margin-bottom: 1rem;
        }

        .mt-3 {
            margin-top: 1rem;
        }

        .container {
            max-width: 600px;
            width: 100%;
            padding: 1rem;
        }

        .text-muted {
            color: #6c757d;
        }

        .card {
            background-color: #212529;
            border-radius: 0.25rem;
            box-shadow: 0 0.5rem 1rem rgba(0, 0, 0, 0.15);
            overflow: hidden;
        }

        .card-body {
            padding: 2rem;
        }

        .card-footer {
            padding: 1rem 2rem;
            background-color: #343a40;
        }

        .badge {
            border-radius: 0.25rem;
            padding: 0.25rem 0.5rem;
            font-size: 0.875rem;
            font-weight: 700;
            line-height: 1;
            display: inline-block;
            text-align: center;
        }

        .bg-secondary {
            background-color: #343a40;
            color: #aeb2b6;
        }

        .message {
            font-size: 1.25rem;
            margin-bottom: 0;
            font-weight: 500;
        }

        .text-secondary {
            color: #6c757d;
        }

        .justify-content-between {
            justify-content: space-between;
        }

        .align-items-center {
            align-items: center;
        }

        .text-secondary a {
            color: #6c757d;
            text-decoration: none;
        }

        .text-secondary a:hover {
            color: #6c757d;
            text-decoration: underline;
        }

        .justify-content-end {
            justify-content: flex-end;
        }

        .justify-content-center {
            justify-content: center;
        }

        .text-center {
            text-align: center;
        }

        .mt-5 {
            margin-top: 3rem;
        }

        .m-0 {
            margin: 0;
        }

        code {
            font-size: 0.875rem;
            border-radius: 0.25rem;
            padding: 0.25rem 0.5rem;
            font-size: 0.875rem;
            font-weight: 700;
            line-height: 1;
            display: inline-block;
            text-align: center;
            background-color: #343a40;
        }
    </style>
</head>

<body>
    <div class="container">
        <div class="card">
            <div class="card-body">
                <div class="d-flex">
                    <div class="me-3">
                        <img height="50px" alt="Phenomine" src="data:image/svg+xml;base64," />
                    </div>
                </div>

                <p class="message">
                    Welcome to The Phenomine Framework
                </p>
                <p class="text-white">
                Phenomine stands at the forefront of innovation in the realm of PHP development, offering a robust and efficient Model-View-Controller (MVC) framework. Designed with a commitment to excellence, Phenomine empowers developers with a versatile toolkit, combining power, speed, and simplicity for a seamless development experience.
                </p>
                <p class="text-secondary">
                    This page is located at <code>res/views/welcome.latte.php</code>. You can modify it according to your needs. If you want to learn more about Phenomine, you can visit the official website or read the documentation.
                </p>
            </div>
            <div class="card-footer">
                <div class="text-secondary">
                    <a href="https://github.com/phenomine" class="me-3">
                        See on GitHub
                    </a>
                    <a href="https://phenomine.spentura.com">
                        Read the docs
                    </a>
                </div>
            </div>
        </div>
        <div class="text-center mt-5">
            <small class="text-secondary">Build v.{Phenomine\Support\Application::VERSION} running with PHP {phpversion()}</small>
            <p class="m-0"><small class="text-secondary">The Phenomine Framework</small></p>
            <p class="m-0"><small class="text-secondary">Built in Indonesia by <a href="https://github.com/fahlisaputra">@fahlisaputra</a></p>
        </div>
    </div>
</body>

</html>
